// SPDX-License-Identifier: GPL-3.0

pragma solidity >=0.8.2 <0.9.0;

contract StorePower {
    mapping(uint => mapping(uint => uint)) public truckKWH;
    mapping(uint => mapping(uint => uint)) public truckA;
    mapping(uint => mapping(uint => uint)) public truckPF;

    function uploadKWH(
       uint _date,
       uint _location,
       uint  _values
   ) public {
       truckKWH[_date][_location] = _values;
   }

    function uploadA(
       uint _date,
       uint _location,
       uint  _values
   ) public {
       truckA[_date][_location] = _values;
   }

    function uploadPF(
       uint _date,
       uint _location,
       uint  _values
   ) public {
       truckPF[_date][_location] = _values;
   }

    function getKWH(  uint _date, uint _location) public view returns (uint) {
     return truckKWH[_date][_location];
    }

    function getA(  uint _date, uint _location) public view returns (uint) {
     return truckA[_date][_location];
    }

    function getPF(  uint _date, uint _location) public view returns (uint) {
     return truckPF[_date][_location];
    }


}

